import React, { component } from 'react';
import './App.css';

class App extends Component {
  render(){
    return(
        <div className="App"> 
          <div className="App-header"> 
            <h2> Cryptocurrency Ticker </h2>
          </div>
        </div>
      );
  }
}

export default App;
